import React, {useState,useEffect} from 'react'
import SearchBar from "./Components/SearchBar";
import "./App.css";

function App() {
  const [data,setData] = useState([{}])
  const titles = []
  useEffect(() => {
    fetch("/titles").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        titles = data["titles"]
      }
    )
  },[])
  return (
    <div className="App">
      <SearchBar placeholder="Enter the Movie You Like" data={data["titles"]} />
      <p> {titles} </p>
    </div>
  );
} 

export default App;
